/** @format */

import React from "react";

const Card = () => {
  return (
    <div className="row  mt-1 ">
      <div class="col p-0">
        <div class="card h-100 d-flex flex-row ">
          <img src="imges/1.png" class="card-img-top img-item" alt="..." />
          <div class="card-body" style={{ backgroundColor: "#F8F8F8" }}>
            <h5 class="card-title">
              <div className=" mb-4 pt-2 d-flex justify-content-between">
                <h5 className="item-title">وجبة</h5>
                <h5 className="item-price">200 ريال</h5>
              </div>
            </h5>
            <p class="card-text item-description">
              This is a longer card with supporting text below as a natura
            </p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Card;
